import { useState } from "react"

import "./form.css"

function Form(){
    const [val,setval]=useState("anil")
    return(
        <>
        <form>

            <label>Enter your name:

            <input type='text' value={val} onChange={(e)=> setval (e.target.val)} /> 
            </label>
        </form>
        </>
    )
}

export default Form;
